import React from "react";
import { useState } from "react";

function Counter() {
    const [count, setCount] = useState(false);
    return (
        <div className="flex-col text-center bg-amber-100">
            <h2 className="text-red-600">Berapa {count}?</h2>
            <button onClick={() => setCount(count - 1)}>input -</button>
            <button onClick={() => setCount(count + 1)}>input +</button>
        </div>
    );
}

export default Counter;
